import React from 'react'
import '../Home.css';
import 'bootstrap/dist/css/bootstrap.min.css';


import MaskGroup3 from "../images/MaskGroup3.png";
import MaskGroup4 from "../images/Group4.png";


function fundoImgTokenizeTudo(){
    return ( 
    <section>
        <div class="container">
            <div class="row ">
                <div class="col-lg-12 col-md-12 col-sm-12 ">
                    <div id="NossosServicos">
                        <p style={{
                                color: "#C8C8C8",
                                fontSize: "25px",
                                fontWeight: "bold",
                                }}>
                                Tokenize tudo
                        </p>
                        <h3 style={{ fontWeight: "bold", color: "#454545" }}>
                            A Nova Economia Criativa
                        </h3>
                    </div>
                </div>
            </div>
        </div>
        <div >       
            <img  src={MaskGroup3} 
                    class="img-fluid"  
                    alt="FundoGoTokens"
                    style={{ position:"absolute", zIndex:"-2"}}
                    >
            </img>        
            <div class="bolhaDireita">
                <img
                    style={{position:"absolute", zIndex:"-1", right:"0px"}}
                    src={MaskGroup4}
                    class="img-fluid"
                    alt="">       
                </img> 
            </div>
        </div> 
        
    </section>           

    );
}

export default fundoImgTokenizeTudo;
